import React from 'react';
import Tabs from './Tabs';
import tesla from '../Tesla/Model_S/img/s1.jpg';
import '../css/catelog_css.css';
import g1 from '../images/mercedes/g1.jpeg';
import bentley2 from '../images/bentley/bentley2.jpg';
import porsche3 from '../images/porsche/porsche3.jpg';
import dawn2 from '../images/Dawn/dawn2.jpg';
import mas1 from '../images/Maserati/mas1.jpg';
import hu9 from '../images/hyundai/hu9.jpg';
import phantom2 from '../images/phantom/phantom2.png';
import intro2 from '../images/Lexus_IS500_intro2.jpg';
import cooper4 from '../images/minicooper/cooper4.jpg';
import g2 from '../images/mercedes/g2.png';
import compass3 from '../images/compass/compass3.jpg';
import ford from '../images/ford/ford.jpg';
import fortuner from '../images/fortuner/fortuner.jpeg';
// import { Route, Link } from 'react-router-dom';

const model = [
  {
    electric: [
      { model_name: 'Model S', location: tesla },
      { model_name: 'Model 3', location: g1 },
      { model_name: 'Model X', location: g1 },
      { model_name: 'Model_Y', location: g1 },
    ],
  },
  {
    convertibles: [
      { model_name: 'Bentley', location: bentley2 },
      { model_name: 'Porsche', location: porsche3 },
      { model_name: 'Rolls Royce Dawn', location: dawn2 },
      { model_name: 'Maserati', location: mas1 },
    ],
  },
  {
    Sedan: [
      { model_name: 'Hyundai Verna', location: hu9 },
      { model_name: 'Rolls oyce_phantom', location: phantom2 },
      { model_name: 'lexus', location: intro2 },
    ],
  },

  {
    Hatch_back: [
      { model_name: 'mini_cooper', location: cooper4 },
      { model_name: 'ford', location: ford },
    ],
  },

  {
    suv: [
      { model_name: 'mercedes', location: g2 },
      { model_name: 'jeep_compass', location: compass3 },
      { model_name: 'fortuner', location: fortuner },
    ],
  },
  {
    premium: [
      { model_name: 'phantom', location: phantom2 },
      { model_name: 'mercedes', location: mas1 },
      { model_name: 'porsche', location: porsche3 },
      { model_name: 'maserati', location: mas1 },
    ],
  },
  {
    luxury: [
      { model_name: 'Rolls_royce_dawn', location: dawn2 },
      { model_name: 'lexus', location: intro2 },
      { model_name: 'mercedes', location: g2 },
    ],
  },
  {
    off_road: [
      { model_name: 'mercedes', location: g2 },
      { model_name: 'jeep_compass', location: compass3 },
    ],
  },
  {
    sports: [
      { model_name: 'porsche', location: porsche3 },
      { model_name: 'maserati', location: mas1 },
    ],
  },
  {
    popular: [
      { model_name: 'ford', location: ford },
      { model_name: 'Model_S', location: tesla },
      { model_name: 'lexus', location: intro2 },
      { model_name: 'mini_cooper', location: cooper4 },
    ],
  },
];
// const vals = model[1];
// console.log(vals);
// var cc;
class Catelog extends React.Component {
  // constructor() {
  //   super();
  //   this.state = { modelname: };
  // }
  render() {
    return (
      <div>
        <Tabs />
        <div>
          {/* {console.log(model.this.props.location.pathname.slice(1))} */}
          {model.map((cat) => (
            <div className="cards">
              {Object.keys(cat).map((indiv, index) => (
                <>
                  {this.props.location.pathname.slice(1) == indiv
                    ? cat[indiv].map((co) => (
                        <>
                          <div className="car_pic">
                            <img alt="car-pic" src={co.location} />
                          </div>
                          <div className="title">{co.model_name}</div>
                          <div className="btn">More Info.</div>
                        </>
                      ))
                    : console.log(indiv)}
                </>
              ))}
            </div>
          ))}
        </div>
      </div>
    );
  }
}
export default Catelog;
